import HeaderNavbar from './HeaderNavbar';
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const NovoUsuario = () => {
  const navigate = useNavigate();

  const [nome, setNome] = useState('');
  const [sobrenome, setSobrenome] = useState('');
  const [email, setEmail] = useState('');
  const [senha, setSenha] = useState('');
  const [confirmarSenha, setConfirmarSenha] = useState('');
  const [perfil, setPerfil] = useState('');
  const [erro, setErro] = useState(null);

  const handleSalvar = () => {
    // Implemente a lógica de validação dos campos e ação de salvar aqui
    // Exemplo de validação:
    if (!nome || !sobrenome || !email || !senha || !confirmarSenha || !perfil) {
      setErro('Todos os campos são obrigatórios.');
      return;
    }
    if (email.length > 100) {
      setErro('O email deve ter no máximo 100 caracteres.');
      return;
    }
    if (senha.length < 5) {
      setErro('A senha deve ter no mínimo 5 caracteres.');
      return;
    }
    if (nome.length > 20) {
      setErro('O nome deve ter no máximo 20 caracteres.');
      return;
    }
    if (sobrenome.length > 100) {
      setErro('O sobrenome deve ter no máximo 100 caracteres.');
      return;
    }
    if (senha !== confirmarSenha) {
      setErro('As senhas não coincidem.');
      return;
    }

    // Se passar pelas validações, pode prosseguir com a ação de salvar
    // Aqui você pode implementar a lógica de salvar no banco de dados, por exemplo

    // Após salvar, redirecionar para a página de usuários
    navigate('/usuarios');
  };

  const handleCancelar = () => {
    // Ação de cancelar, redirecionando para a página de usuários
    navigate('/usuarios');
  };

  return (
    <div>
      <HeaderNavbar />
      <main className='appp'>
        <div className="container">
          <h1>Novo Usuário</h1>
          {erro && <div className="alert alert-danger">{erro}</div>}
          <div>
            <label>Nome:</label>
            <input type="text" value={nome} onChange={(e) => setNome(e.target.value)} />
          </div>
          <div>
            <label>Sobrenome:</label>
            <input type="text" value={sobrenome} onChange={(e) => setSobrenome(e.target.value)} />
          </div>
          <div>
            <label>Email:</label>
            <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} />
          </div>
          <div>
            <label>Senha:</label>
            <input type="password" value={senha} onChange={(e) => setSenha(e.target.value)} />
          </div>
          <div>
            <label>Confirmar Senha:</label>
            <input type="password" value={confirmarSenha} onChange={(e) => setConfirmarSenha(e.target.value)} />
          </div>
          <div>
            <label>Perfil:</label>
            <select value={perfil} onChange={(e) => setPerfil(e.target.value)}>
              <option value="">Selecione...</option>
              <option value="Admin">Admin</option>
              <option value="Dev">Dev</option>
              <option value="Padrão">Padrão</option>
            </select>
          </div>
          <div>
            <button type="button" onClick={handleSalvar}>Salvar</button>
            <button type="button" onClick={handleCancelar}>Cancelar</button>
          </div>
        </div>
      </main>
    </div>
  );
};

export default NovoUsuario;
